import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { useHistory } from "react-router-dom";
import {
  findBreeds,
  getAllTemperaments,
  clearFilters,
  clearSearch,
} from "../../redux/actions";
import logo from "../../images/favicon2.png";
import "./header.css";

const Header = () => {
  const dispatch = useDispatch();
  const history = useHistory();

  const breeds = useSelector((state) => state.breeds);

  useEffect(() => {
    dispatch(findBreeds());
    dispatch(getAllTemperaments());
    dispatch(clearFilters());
    dispatch(clearSearch());
  }, []);

  const handleHome = () => {
    history.push("/home");
  };

  const handleExit = () => {
    history.push("/");
  };

  return (
    <header>
      <div className="header-container">
        <div className="header-left">
          <Link to="/home" onClick={handleHome}>
            <img src={logo} alt="Dog App Logo" />
          </Link>
          <h1>Henry Dogs Store</h1>
        </div>
        <div className="header-right">
          <button onClick={handleHome} className="button_home">
            Home
          </button>
          <button onClick={handleExit} className="button_exit">
            Exit
          </button>
        </div>
      </div>
    </header>
  );
};

export default Header;
